package org.tutev.envanterys.ws;

public class Il {
	
	public Il() {
		// TODO Auto-generated constructor stub
	}
	
	
	public Il(String kod, String adi) {
		super();
		this.kod = kod;
		this.adi = adi;
	}


	String kod;
	String adi;

	public String getKod() {
		return kod;
	}

	public void setKod(String kod) {
		this.kod = kod;
	}

	public String getAdi() {
		return adi;
	}

	public void setAdi(String adi) {
		this.adi = adi;
	}
}
